// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity 0.8.4;

import "../interface/IBridge.sol";
import "../interface/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

//import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
//import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
//import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Metadata.sol";
//import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
//import "@openzeppelin/contracts/token/ERC721/presets/ERC721PresetMinterPauserAutoId.sol";

contract ERC721Handler is Ownable {
    // resourceID
    bytes32 public rID;

    // bridge合约地址
    address public bridgeAddress;

    // 跨链的代币合约地址
    address public tokenAddress;

    // 目标链上ERC20 handler地址
    address public targetHandler;

    // 跨链的代币是否需要burn
    bool public burnable;

    // Initializes Manager
    constructor(
        bytes32 _resourceID,
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) {
        rID = _resourceID;
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // 设置
    function adminSetConfig(
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) public onlyOwner {
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    function deposit(
        bytes32 resourceID,
        uint32 targetChainId,
        uint256 tokenID
    ) public returns (bytes32) {
        require(resourceID == rID, "resourceID error");

        bytes memory metaData;
        IERC721Metadata erc721Metadata = IERC721Metadata(tokenAddress);
        metaData = bytes(erc721Metadata.tokenURI(tokenID));

        if (burnable) {
            ERC721Burnable erc721Burn = ERC721Burnable(tokenAddress);
            erc721Burn.burn(tokenID);
        } else {
            IERC721 erc721 = IERC721(tokenAddress);
            erc721.transferFrom(msg.sender, address(this), tokenID);
        }

        bytes memory data = abi.encode(msg.sender, tokenID, metaData);

        // Call bridge
        IBridge bridge = IBridge(bridgeAddress);
        bytes32 messageId = bridge.callRemote(
            resourceID,
            targetChainId,
            targetHandler,
            data
        );

        return messageId;
    }

    function execute(bytes32 resourceID, bytes calldata data) public {
        require(resourceID == rID, "resourceID error");
        address sender;
        uint256 tokenID;
        bytes memory metaData;
        (sender, tokenID, metaData) = abi.decode(
            data,
            (address, uint256, bytes)
        );
        if (burnable) {
            // mint
            IERC721PresetMinterPauserAutoId erc721Preset = IERC721PresetMinterPauserAutoId(
                    tokenAddress
                );
            erc721Preset.mint(sender);
        } else {
            // release
            IERC721 erc721 = IERC721(tokenAddress);
            erc721.transferFrom(address(this), sender, tokenID);
        }
    }

    // 用于测试
    function BalanceOfThisHandler() external returns (uint256) {
        IERC721 erc721 = IERC721(tokenAddress);
        return erc721.balanceOf(address(this));
    }
}

